import { useRef } from "react";
import classes from "./YoutubeForm.module.css";

const YoutubeForm = (props) => {
  const linkRef = useRef();
  const wordRef = useRef();

  const submitHandler = () => {
    preventDefault();
    props.storeLink(linkRef.current);
    props.storeWord(wordRef.current);
  };

  return (
    <form className={classes.form} onSubmit={submitHandler}>
      <input ref={linkRef} placeholder="Youtube Link" />
      <input ref={wordRef} placeholder="Word Query" />
      <button type="submit">Find</button>
    </form>
  );
};

export default YoutubeForm;
